import React from 'react';
import './Login.css';

function Register() {
  return (
    <div className='card'>
        <h1> Register</h1>
        <div className='textbox'>
        <input type="text"   placeholder="username" ></input>
        </div>
        <div className='textbox'>
        <input type="password"  placeholder="password" ></input>       
        </div>     
            <div>
            <button>Register</button>
            </div>
          
    </div>
  );
}

export default Register;
